import React from "react";
import { LineChart, Line, XAxis, YAxis, PieChart,Pie,CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
  { "id": 1, "user_id": "4398", "package": "Plan 1", "expires_on": "2022-06-22 17:32:01" },
  { "id": 2, "user_id": "4632", "package": "Plan 2", "expires_on": "2021-04-24 13:31:33" },
  { "id": 3, "user_id": "4432", "package": "Plan3", "expires_on": "2019-06-07 12:03:15" },
  { "id": 4, "user_id": "4651", "package": "Plan 6", "expires_on": "2019-06-14 09:44:29" },
  { "id": 5, "user_id": "4577", "package": "Plan 12", "expires_on": "2021-02-25 08:15:11" },
  { "id": 6, "user_id": "4388", "package": "Plan Unlimited", "expires_on": "2020-05-12 10:35:21" },
  { "id": 7, "user_id": "4650", "package": "Plan 1", "expires_on": "2019-08-19 07:43:55" },
  { "id": 8, "user_id": "4475", "package": "Plan 2", "expires_on": "2018-10-04 10:23:07" },
  { "id": 9, "user_id": "4368", "package": "Plan3", "expires_on": "2019-04-09 12:04:36" },
  { "id": 10, "user_id": "4652", "package": "Plan 6", "expires_on": "2022-07-25 19:28:49" },
  { "id": 11, "user_id": "4629", "package": "Plan 12", "expires_on": "2018-12-16 01:19:08" },
  { "id": 12, "user_id": "4556", "package": "Plan Unlimited", "expires_on": "2020-12-04 17:26:56" }
];
const data01 = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 },
  { name: 'Group D', value: 200 },
  { name: 'Group E', value: 278 },
  { name: 'Group F', value: 189 },
];
const plan1 = data.filter(item => item.package === 'Plan 1').length;
const plan2 = data.filter(item => item.package === 'Plan 2').length;
const plan3 = data.filter(item => item.package === 'Plan3').length;
const plan6 = data.filter(item => item.package === 'Plan 6').length;
const plan12 = data.filter(item => item.package === 'Plan 12').length;
const planunlimited = data.filter(item => item.package === 'Plan Unlimited').length;
console.log(plan1);
console.log(plan2);
console.log(plan3);
console.log(plan6);
console.log(plan12);
console.log(planunlimited);

const Dashboard = () => {
  return (
    <div className='content-wrapper'>
      <div className="container content">
        <div className='card rounded-0'>
          <div className="card-header">
            <div className="card-title mb-0">
              <span className="content-header">chart</span>
            </div>
          </div>
          <div className='card-body'>
            <ResponsiveContainer width="100%" height="100%" aspect={3}>
              <PieChart width={400} height={400}>
                <Pie
                  dataKey="value"
                  isAnimationActive={false}
                  data={data01}
                  cx="50%"
                  cy="50%"
                  outerRadius={80}
                  fill="#8884d8"
                  label
                />
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
            <ResponsiveContainer width="100%" aspect={3} height="100%">
              <LineChart width={500} height={300}
                data={data}

              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey={plan1} />
                <YAxis dataKey={100}/>
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="count" stroke="#8884d8" activeDot={{ r: 8 }} />
                <Line type="monotone" dataKey="user_id" stroke="#82ca9d" />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>
    
    </div>
  );
};

export default Dashboard;
